import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      term: '',
      items: []
    };
  }

  render () {
    return (
      <div>
        Hi this todo list
      </div>
    );
  }

}

export default App;
